import classes from "./ContactPerson.module.css";

function ContactPerson() {
    return (
        <div>
            <img className={classes.avatar} alt=""/>
            <div>
                <div>名字</div>
                <div>內容內容內容</div>
            </div>
        </div>
    );
}

export default ContactPerson;
